import React from "react";

function Login(){
    return(
        <div>
            <h1>Login</h1>
            <form>
                <input type="text" placeholder="Enter username"/>
                <input type="text" placeholder="Enter Pass"/>
                <button>Submit</button>
            </form>
        </div>
    )
}
export default Login;
